== Own article ==

Should this have its own article? We don't have anything much about the statue here and I am not sure it is notable as an artwork. Would it not be better to move this all into the [[James Outram]] article? --[[User:DanielRigal|DanielRigal]] ([[User talk:DanielRigal|talk]]) 15:58, 31 May 2015 (UTC)

:{{ping|DanielRigal}} The statue was originally intended for, but rejected for, Trafalgar Square, which is quite interesting! As a Grade II-listed statue it's as notable as many of the works already in [[:Category:Statues in London]]; the others in that category listed at that grade are the statues of the Duke of Cambridge, Clive of India, Captain Cook, Oliver Cromwell, the Earl of Derby, the Duke of Devonshire, Disraeli, Haig, Havelock, Irving, Jenner, Myddelton, Napier, Palmerston, Peel, Raikes, Reynolds, Shakespeare, White and Wolseley. I'll work on the article later in the week. [[User:Ham II|Ham II]] ([[User talk:Ham II|talk]]) 20:27, 31 May 2015 (UTC)

